import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import { useAuth } from '../../hooks/useAuth';
import { supabase } from '../../services/supabaseClient';

const Dashboard = () => {
  const { user } = useAuth();
  const [clients, setClients] = useState([]);
  const [upcomingSessions, setUpcomingSessions] = useState([]);
  const [recentSummaries, setRecentSummaries] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchDashboardData = async () => {
      try {
        // Fetch assigned clients
        const { data: clientsData, error: clientsError } = await supabase
          .from('clients')
          .select(`
            *,
            users:user_id (email, profile_data),
            client_behaviors (behavior_id)
          `)
          .eq('therapist_id', user.id);

        if (clientsError) throw clientsError;

        // Fetch upcoming sessions
        const { data: sessionsData, error: sessionsError } = await supabase
          .from('sessions')
          .select(`
            *,
            clients (
              user_id,
              users:user_id (email, profile_data)
            )
          `)
          .eq('therapist_id', user.id)
          .gt('start_time', new Date().toISOString())
          .order('start_time', { ascending: true })
          .limit(5);

        if (sessionsError) throw sessionsError;

        // Fetch recent conversation summaries
        const { data: summariesData, error: summariesError } = await supabase
          .from('summaries')
          .select(`
            *,
            conversations (
              client_id,
              clients (
                user_id,
                users:user_id (email, profile_data)
              )
            )
          `)
          .eq('therapist_id', user.id)
          .order('created_at', { ascending: false })
          .limit(5);

        if (summariesError) throw summariesError;

        setClients(clientsData || []);
        setUpcomingSessions(sessionsData || []);
        setRecentSummaries(summariesData || []);
      } catch (error) {
        console.error('Error fetching dashboard data:', error);
      } finally {
        setLoading(false);
      }
    };

    fetchDashboardData();
  }, [user.id]);

  if (loading) {
    return (
      <div className="flex items-center justify-center h-full">
        <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-primary-500"></div>
      </div>
    );
  }

  return (
    <div className="space-y-6">
      {/* Welcome Section */}
      <div className="bg-white rounded-lg shadow p-6">
        <h1 className="text-2xl font-semibold text-secondary-900">
          Welcome, Dr. {user.profile_data?.name || 'Therapist'}
        </h1>
        <p className="mt-2 text-secondary-600">
          Manage your clients and review AI-generated insights.
        </p>
      </div>

      {/* Quick Stats */}
      <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
        <div className="bg-white rounded-lg shadow p-6">
          <h3 className="text-lg font-medium text-secondary-900">Active Clients</h3>
          <p className="mt-2 text-3xl font-bold text-primary-600">{clients.length}</p>
        </div>

        <div className="bg-white rounded-lg shadow p-6">
          <h3 className="text-lg font-medium text-secondary-900">Upcoming Sessions</h3>
          <p className="mt-2 text-3xl font-bold text-primary-600">
            {upcomingSessions.length}
          </p>
        </div>

        <div className="bg-white rounded-lg shadow p-6">
          <h3 className="text-lg font-medium text-secondary-900">Recent Summaries</h3>
          <p className="mt-2 text-3xl font-bold text-primary-600">
            {recentSummaries.length}
          </p>
        </div>
      </div>

      {/* Upcoming Sessions */}
      <div className="bg-white rounded-lg shadow p-6">
        <div className="flex justify-between items-center mb-4">
          <h2 className="text-lg font-medium text-secondary-900">Upcoming Sessions</h2>
          <Link
            to="/therapist/sessions"
            className="text-primary-600 hover:text-primary-700 text-sm font-medium"
          >
            View All
          </Link>
        </div>

        <div className="space-y-4">
          {upcomingSessions.map((session) => (
            <div
              key={session.id}
              className="flex items-center justify-between p-4 bg-secondary-50 rounded-lg"
            >
              <div>
                <p className="font-medium text-secondary-900">
                  {session.clients.users.profile_data.name}
                </p>
                <p className="text-sm text-secondary-600">
                  {new Date(session.start_time).toLocaleString()}
                </p>
              </div>
              <button
                onClick={() => {/* Join session logic */}}
                className="bg-primary-500 text-white px-4 py-2 rounded-lg hover:bg-primary-600"
              >
                Join Session
              </button>
            </div>
          ))}
        </div>
      </div>

      {/* Recent AI Summaries */}
      <div className="bg-white rounded-lg shadow p-6">
        <div className="flex justify-between items-center mb-4">
          <h2 className="text-lg font-medium text-secondary-900">Recent AI Summaries</h2>
          <Link
            to="/therapist/summaries"
            className="text-primary-600 hover:text-primary-700 text-sm font-medium"
          >
            View All
          </Link>
        </div>

        <div className="space-y-4">
          {recentSummaries.map((summary) => (
            <div
              key={summary.id}
              className="p-4 bg-secondary-50 rounded-lg"
            >
              <div className="flex justify-between items-start mb-2">
                <div>
                  <p className="font-medium text-secondary-900">
                    {summary.conversations.clients.users.profile_data.name}
                  </p>
                  <p className="text-sm text-secondary-600">
                    {new Date(summary.created_at).toLocaleString()}
                  </p>
                </div>
                <Link
                  to={`/therapist/clients/${summary.conversations.client_id}`}
                  className="text-primary-600 hover:text-primary-700 text-sm font-medium"
                >
                  View Client
                </Link>
              </div>
              <p className="text-secondary-800">{summary.summary_text}</p>
              <div className="mt-2 flex items-center space-x-2">
                <span className="inline-flex items-center px-2.5 py-0.5 rounded-full text-xs font-medium bg-green-100 text-green-800">
                  Sentiment: {summary.sentiment_score.toFixed(2)}
                </span>
                {summary.key_topics && summary.key_topics.map((topic, index) => (
                  <span
                    key={index}
                    className="inline-flex items-center px-2.5 py-0.5 rounded-full text-xs font-medium bg-primary-100 text-primary-800"
                  >
                    {topic}
                  </span>
                ))}
              </div>
            </div>
          ))}
        </div>
      </div>

      {/* Client List Preview */}
      <div className="bg-white rounded-lg shadow p-6">
        <div className="flex justify-between items-center mb-4">
          <h2 className="text-lg font-medium text-secondary-900">Your Clients</h2>
          <Link
            to="/therapist/clients"
            className="text-primary-600 hover:text-primary-700 text-sm font-medium"
          >
            View All
          </Link>
        </div>

        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-4">
          {clients.slice(0, 6).map((client) => (
            <Link
              key={client.id}
              to={`/therapist/clients/${client.id}`}
              className="p-4 bg-secondary-50 rounded-lg hover:bg-secondary-100 transition-colors"
            >
              <p className="font-medium text-secondary-900">
                {client.users.profile_data.name}
              </p>
              <p className="text-sm text-secondary-600">
                {client.client_behaviors.length} Active Behaviors
              </p>
            </Link>
          ))}
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
